import React from "react";
//import Buton from "react-bootstrap/Form";
// import { Form } from "react-bootstrap-validation"

const ListingPage = () => {
    return (
        <div className="container mt-5">
            {/* onSubmit = {handleSubmit}
            onChange={(e) => sendSignInLinkToEmail(e.target.value)} 
            value={email}  */}

            <Form >
                <Form className="mb-3" controlId="formBasicEmail">
                    <Form.Label>Email Address</Form.Label>
                    <Form
                        type="email"
                        placeholder="Enter email"></Form>
                </Form>

                <Form className="mb-3" controlId="formBasicPassword">
                    <Form>Email Address</Form>
                    <Form
                        type="password"
                        placeholder="Enter password"></Form>
                </Form>
            </Form>
        </div>
    )
}
export default ListingPage
